            let items = csvData.split('\n').map(line => {
                const [name, image, league] = line.split(',');
                return { name, image, league };
            });
        
            // Sort items so that those containing "24-25" appear first
            items = items.sort((a, b) => {
                if (a.name.includes("24-25") && !b.name.includes("24-25")) {
                    return -1;
                } else if (!a.name.includes("24-25") && b.name.includes("24-25")) {
                    return 1;
                } else {
                    return 0;
                }
            });
        
            const itemsPerPage = 30; // Increased number of items per page
            const totalPages = Math.ceil(items.length / itemsPerPage);
            let currentPage = 1;
            let lightbox;
        
            function renderPage(page, filteredItems = items) {
                const start = (page - 1) * itemsPerPage;
                const end = start + itemsPerPage;
                const pageItems = filteredItems.slice(start, end);
        
                const galleryItems = document.getElementById('galleryitems');
                galleryItems.innerHTML = pageItems.map(item => `
                    <div class="item">
                        <div class="itemcontent">
                            <div class="overlay">
                                <a href="${item.image}" class="zoomlink"><i class="fa-solid fa-plus"></i></a>
                                <div class="text">
                                    <h3>${item.name}</h3>
                                    <a href="${item.league}" class="livelink">See Live <i class="fa-solid fa-angle-right"></i></a>
                                </div>
                            </div>
                            <img src="${item.image}" alt="${item.name}" />
                        </div>
                    </div>
                `).join('');
        
                // Initialize or refresh lightbox
                if (lightbox) {
                    lightbox.refresh();
                } else {
                    lightbox = $('.gallery a').simpleLightbox({ history: false, uniqueImages: false });
                }
            }
        
            function renderPagination(filteredItems = items) {
                const pagination = document.getElementById('pagination');
                const totalPages = Math.ceil(filteredItems.length / itemsPerPage);
                let startPage = Math.max(1, currentPage - 2);
                let endPage = Math.min(totalPages, currentPage + 2);
        
                if (endPage - startPage < 4) {
                    if (startPage === 1) {
                        endPage = Math.min(5, totalPages);
                    } else if (endPage === totalPages) {
                        startPage = Math.max(1, totalPages - 4);
                    }
                }
        
                let paginationHTML = `
                `;
        
                for (let i = startPage; i <= endPage; i++) {
                    paginationHTML += `
                        <a href="#" class="${i === currentPage ? 'active' : ''}" data-page="${i}">${i}</a>
                    `;
                }
        
                paginationHTML += `
                    <a href="#" class="prev" ${currentPage === totalPages ? 'style="visibility: hidden;"' : ''}>&laquo;</a>
                    <a href="#" class="next" ${currentPage === totalPages ? 'style="visibility: hidden;"' : ''}>&raquo;</a>
                    <input type="number" id="jumpToPage" min="1" max="${totalPages}" placeholder="Page" style="width: 50px;">
                    <button id="jumpButton">Go</button>
                `;
        
                pagination.innerHTML = paginationHTML;
        
                pagination.querySelectorAll('a').forEach(a => {
                    a.addEventListener('click', function(e) {
                        e.preventDefault();
                        if (this.classList.contains('prev')) {
                            currentPage = Math.max(1, currentPage - 1);
                        } else if (this.classList.contains('next')) {
                            currentPage = Math.min(totalPages, currentPage + 1);
                        } else {
                            currentPage = parseInt(this.getAttribute('data-page'));
                        }
                        renderPage(currentPage, filteredItems);
                        renderPagination(filteredItems);
                    });
                });
        
                document.getElementById('jumpButton').addEventListener('click', function() {
                    const jumpToPage = parseInt(document.getElementById('jumpToPage').value);
                    if (jumpToPage >= 1 && jumpToPage <= totalPages) {
                        currentPage = jumpToPage;
                        renderPage(currentPage, filteredItems);
                        renderPagination(filteredItems);
                    }
                });
            }
        
            document.getElementById('searchButton').addEventListener('click', function() {
                const query = document.getElementById('searchInput').value.toLowerCase();
                const filteredItems = items.filter(item => item.name.toLowerCase().includes(query));
                currentPage = 1;
                renderPagination(filteredItems);
                renderPage(currentPage, filteredItems);
            });
        
            document.querySelectorAll('.filter-button').forEach(button => {
                button.addEventListener('click', function() {
                    const league = this.getAttribute('data-league');
                    const isActive = this.classList.contains('active');
                    document.querySelectorAll('.filter-button').forEach(btn => btn.classList.remove('active'));
                    if (!isActive) {
                        this.classList.add('active');
                        const filteredItems = items.filter(item => item.league === league);
                        currentPage = 1;
                        renderPagination(filteredItems);
                        renderPage(currentPage, filteredItems);
                    } else {
                        renderPagination(items);
                        renderPage(currentPage, items);
                    }
                });
            });
        
            renderPagination();
            renderPage(currentPage);
        });
    </script>
